import React from 'react';
import './D2CMainPage.css';

// Ï†úÎ™©Í≥º Î∂ÄÏ†úÎ™©, ÏÑπÏÖò Ï†úÎ™©Îì§ÏùÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨ÌïòÏó¨ Ï†ïÏùòÌïòÍ≥† ÎÇ¥Î≥¥ÎÉÖÎãàÎã§
export const PAGE_TITLE = "DX Automation for D2C";
export const PAGE_SUBTITLE = "D2C Îß§Ï∂ú ÌòÑÌô© Î∞è ÏõêÏù∏ Î∂ÑÏÑù ÎèÑÍµ¨";

// ÏÑπÏÖò Ï†úÎ™©Îì§ÎèÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const SECTION_TITLES = {
  SERVICE_OVERVIEW: "ÏÑúÎπÑÏä§ Í∞úÏöî",
  D2C_STRATEGY: "Ìö®Í≥ºÏ†ÅÏù∏ D2C Ï†ÑÎûµ",
  START_NOW: "ÏßÄÍ∏à ÏãúÏûëÌï¥Î≥¥ÏÑ∏Ïöî"
};

// ÏÑúÎπÑÏä§ ÏÑ§Î™ÖÏùÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const SERVICE_DESCRIPTION = 
  "Ìï¥Ïô∏Î≤ïÏù∏ÏóêÏÑú Ïö¥ÏòÅÌïòÎäî OBS (Online Brand Shop)ÏóêÏÑú ÏàòÏßëÎêòÎäî Îß§Ï∂ú Î∞è Í≥†Í∞ùÏõπÌñâÎèô Îç∞Ïù¥ÌÑ∞Î•º Í∏∞Î∞òÏúºÎ°ú " +
  "Îß§Ï∂úÌòÑÌô©Í≥º ÌåêÎß§ÎüâÏùÑ Î≤ïÏù∏Ï†ÑÏ≤¥/Ï†úÌíàÍµ∞/Î™®Îç∏ Îã®ÏúÑÎ°ú ÌååÏïÖÌïòÍ≥†, Îß§Ï∂úÌïòÎùΩ Îì±Ïùò Ïù¥ÏäàÏóê ÎåÄÌïú ÏõêÏù∏ÏùÑ OBS Funnel Îã®Í≥Ñ " +
  "Î∞è OBS Ïú†ÏûÖ Ï±ÑÎÑê Í¥ÄÏ†êÏóêÏÑú ÌååÏïÖÌïòÍ≥† Ìï¥Í≤∞Î∞©ÏïàÏùÑ Ï†úÏãúÌï©ÎãàÎã§.";

// ÌÜµÍ≥Ñ Îç∞Ïù¥ÌÑ∞Î•º ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const STATS_DATA = [
  { value: "42%", label: "Í≥†Í∞ù Ïú†ÏßÄÏú® Ï¶ùÍ∞Ä" },
  { value: "3.5x", label: "ROI Ìñ•ÏÉÅ" },
  { value: "67%", label: "ÎßàÏºÄÌåÖ ÏûêÎèôÌôî Ìö®Ïú®" }
];

// Îç∞Î™® ÏÑπÏÖò ÌÖçÏä§Ìä∏Î•º ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const DEMO_SECTION = {
  DESCRIPTION: "DX Automation for D2C ÏÜîÎ£®ÏÖòÏúºÎ°ú Í≥†Í∞ù Ï§ëÏã¨Ïùò ÎπÑÏ¶àÎãàÏä§ ÌòÅÏã†ÏùÑ Í≤ΩÌóòÌï¥Î≥¥ÏÑ∏Ïöî.",
  BUTTON_TEXT: "Îç∞Î™® ÏöîÏ≤≠ÌïòÍ∏∞"
};

// ÏÑúÎπÑÏä§ Í∏∞Îä• Ïπ¥Îìú Îç∞Ïù¥ÌÑ∞Î•º ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const FEATURE_CARDS = [
  {
    icon: "üìä",
    title: "Í≥†Í∞ù Îç∞Ïù¥ÌÑ∞ ÌÜµÌï©",
    description: "Îã§ÏñëÌïú ÏÜåÏä§Ïùò Í≥†Í∞ù Îç∞Ïù¥ÌÑ∞Î•º ÌÜµÌï©ÌïòÏó¨ Îã®Ïùº Î∑∞ÏóêÏÑú Í¥ÄÎ¶¨Ìï† Ïàò ÏûàÏäµÎãàÎã§."
  },
  {
    icon: "üîÑ",
    title: "ÏûêÎèôÌôî ÏõåÌÅ¨ÌîåÎ°úÏö∞",
    description: "Î≥µÏû°Ìïú Í≥†Í∞ù Ïó¨Ï†ïÏùÑ ÏûêÎèôÌôîÌïòÏó¨ Ìö®Ïú®Ï†ÅÏù∏ ÎßàÏºÄÌåÖ Ïö¥ÏòÅÏù¥ Í∞ÄÎä•Ìï©ÎãàÎã§."
  },
  {
    icon: "üì±",
    title: "Ïò¥ÎãàÏ±ÑÎÑê Í≤ΩÌóò",
    description: "Î™®Îì† Ï†ëÏ†êÏóêÏÑú ÏùºÍ¥ÄÎêú Í≥†Í∞ù Í≤ΩÌóòÏùÑ Ï†úÍ≥µÌïòÎèÑÎ°ù ÏÑ§Í≥ÑÎêòÏóàÏäµÎãàÎã§."
  },
  {
    icon: "üß†",
    title: "AI Í∏∞Î∞ò Î∂ÑÏÑù",
    description: "Í≥†Í∏â AI ÏïåÍ≥†Î¶¨Ï¶òÏùÑ ÌôúÏö©ÌïòÏó¨ Í≥†Í∞ù ÌñâÎèôÏùÑ ÏòàÏ∏°ÌïòÍ≥† Ïù∏ÏÇ¨Ïù¥Ìä∏Î•º ÎèÑÏ∂úÌï©ÎãàÎã§."
  }
];

const D2CMainPage = () => {
  // Í∏∞Îä• Ïπ¥Îìú ÌëúÏãú Ïó¨Î∂Ä (ÌïÑÏöîÏãú trueÎ°ú Î≥ÄÍ≤Ω)
  const showFeatureCards = false;

  return (
    <div className="d2c-main-page">
      <div className="page-header">
        <h1>{PAGE_TITLE}</h1>
        <p className="subtitle">{PAGE_SUBTITLE}</p>
      </div>

      <div className="feature-section">
        <h2>{SECTION_TITLES.SERVICE_OVERVIEW}</h2>
        <div className="service-description-container">
          <p className="service-description">{SERVICE_DESCRIPTION}</p>
          <div className="service-tags">
            <span className="service-tag">Îß§Ï∂ú Î∂ÑÏÑù</span>
            <span className="service-tag">OBS Funnel</span>
            <span className="service-tag">ÏõêÏù∏ Î∂ÑÏÑù</span>
            <span className="service-tag">Ìï¥Í≤∞Î∞©Ïïà Ï†úÏãú</span>
          </div>
        </div>
        <div className="feature-grid">
          {showFeatureCards && FEATURE_CARDS.map((card, index) => (
            <div className="feature-card" key={index}>
              <div className="icon">{card.icon}</div>
              <h3>{card.title}</h3>
              <p>{card.description}</p>
            </div>
          ))}
        </div>
      </div>

      <div className="stats-section">
        <h2>{SECTION_TITLES.D2C_STRATEGY}</h2>
        <div className="stats-container">
          {STATS_DATA.map((stat, index) => (
            <div className="stat-item" key={index}>
              <span className="stat-value">{stat.value}</span>
              <span className="stat-label">{stat.label}</span>
            </div>
          ))}
        </div>
      </div>

      <div className="demo-section">
        <h2>{SECTION_TITLES.START_NOW}</h2>
        <p>{DEMO_SECTION.DESCRIPTION}</p>
        <button className="demo-button">{DEMO_SECTION.BUTTON_TEXT}</button>
      </div>
    </div>
  );
};

export default D2CMainPage;
